import { useState } from 'react';
import './containerData.css'


function ContainerData({data}){

    const [temp, setTemp] = useState()

    return(

        <div className='containerData'>

            <div className='date'>

                <span>Ola</span>

            </div>

            <div className='date'>

                <span>Temperatura</span>
                <span>{data.main}</span>
              

            </div>

            <div className='date'>

                <span>Ola</span>

            </div>

            
          

        </div>

    );

}

export default ContainerData;
